  \"frequency-of-update\",\n\t\t\"value\": \"notPlanned\"\n\t},\n\t{\n\t\t\"key\":
  \"licence\",\n\t\t\"value\": \"[\"The dataset cannot be used to quantify all aspects
  of climate variability and change without any additional processing. In general,
  the stations providing daily observations were not managed to meet the desired standards
  for climate monitoring. Rather, the stations were deployed to meet the demands of
  agriculture, hydrology, weather forecasting, aviation, etc. GHCN-Daily data have
  not been homogenized to account for the potential artifacts associated with the
  various reporting practices at stations. Users must consider whether the potential
  for changes in systematic bias might be important for their particular application.\"]\"\n\t},\n\t{\n\t\t\"key\":
